import React, { Component } from 'react';

class Index extends Component {
    render() {
        return(
            <div id='customers'>

                <p id='firstname'> {this.props.customers.first_name}</p>

                <p id='lastname'> {this.props.customers.last_name}</p>

                <p id='homecity'> {this.props.customers.home_city}</p>
            </div>

        )
    }   
}

export default Index;
